import React from "react";

import { IconButton, InputAdornment, TextField } from "@material-ui/core";
import VisibilityOffIcon from "@material-ui/icons/VisibilityOff";
import VisibilityIcon from "@material-ui/icons/Visibility";
import { ItextfIeldSignup } from "./log-Interfaces";

function TextFieldSignupx({
  updateSignvalues,
  rawSignupValues,
  signupShowPassword,
  ShowSignupPasswordForaWhile,
  size,
  passwordType,
  emailType,
  withHolder,
}: ItextfIeldSignup): JSX.Element {
  var widthTrue = "";
  var width = " ";
  var sizex = " ";

  switch (size) {
    case "small":
      sizex = "small";
      width = "99%";
      var transform = "scale(0.93)";
      var zIndex = 0;
      var font1 = "";
      var font2 = "";
      break;
    case "smallTablet":
      sizex = "small";
      width = "62%";
      var transform = "scale(1)";
      var zIndex = 0;
      var font1 = "2.6vh";
      var font2 = "2vh";
      break;
    default:
      sizex = "medium";
      width = withHolder;
      var transform = "scale(1)";
      var zIndex = 1;
      var font1 = "2.7vh";
      var font2 = "1.9vh";
  }

  var width = " ";
  var sizex = " ";

  switch (size) {
    case "small":
      sizex = "small";
      width = "100%";
      var transform = "scale(0.94)";
      var paddingBottomE = "45px";
      var paddingBottomP = "65px";
      var paddingBottomU = "65px";
      var zIndex = 1;
      var font1 = "";
      var font2 = "";
      break;
    case "smallTablet":
      sizex = "small";
      width = "100%";
      var transform = "scale(1)";
      var paddingBottomE = "45px";
      var paddingBottomP = "65px";
      var paddingBottomU = "65px";
      var zIndex = 1;
      var font1 = "2.6vh";
      var font2 = "2vh";
      break;
    default:
      var width = withHolder;
      var transform = "scale(1)";
      var paddingBottomE = "34px";
      var paddingBottomP = "30px";
      var paddingBottomU = "50px";
      var zIndex = 1;
      var font1 = "2.7vh";
      var font2 = "1.9vh";
  }

  console.log("zerformance sign");
  return (
    <>
      {emailType ? (
        <TextField
          size={size}
          inputProps={{ style: { fontSize: font1 } }}
          InputLabelProps={{ style: { fontSize: font2 } }}
          style={{
            transform: transform,
            width: width,
            paddingBottom: paddingBottomE,
          }}
          label="Email"
          type="email"
          onChange={updateSignvalues}
          name="inputedEmail"
          value={rawSignupValues.inputedEmail}
          variant="standard"
        />
      ) : passwordType ? (
        <TextField
          size={size}
          inputProps={{ style: { fontSize: font1 } }}
          InputLabelProps={{ style: { fontSize: font2 } }}
          style={{
            transform: transform,
            width: width,
            paddingBottom: paddingBottomP,
            zIndex: zIndex,
          }}
          label="Password"
          type={signupShowPassword ? "text" : "password"}
          onChange={updateSignvalues}
          name="inputedPassword"
          value={rawSignupValues.inputedPassword}
          variant="standard"
          InputProps={{
            endAdornment: (
              <InputAdornment position="end">
                <IconButton
                  onMouseDown={ShowSignupPasswordForaWhile}
                  aria-label="toggle password visibility"
                >
                  {signupShowPassword ? (
                    <VisibilityIcon />
                  ) : (
                    <VisibilityOffIcon />
                  )}
                </IconButton>
              </InputAdornment>
            ),
          }}
        />
      ) : (
        <TextField
          size={sizex}
          inputProps={{ style: { fontSize: font1 } }}
          InputLabelProps={{ style: { fontSize: font2 } }}
          style={{
            transform: transform,
            width: width,
            paddingBottom: paddingBottomU,
          }}
          label="Username"
          type="text"
          onChange={updateSignvalues}
          name="inputedUsername"
          value={rawSignupValues.inputedUsername}
          variant="standard"
        />
      )}
    </>
  );
}

export const TextFieldSignup = React.memo(TextFieldSignupx);
